<html><body>
<script>
(async function main(){
	let url = "https://raw.githubusercontent.com/h1bymask/msurobodialog/main/prezo/"
	let response = await fetch(url + "/new_index.html");
	let html = await response.text();
	document.open();
	document.write('<base href="' + url + '">');
	document.write(html);
	document.close();
})();
</script>
</body>
</html>
